import { btn, btnin, data, error, loading } from "./actionType";

function logOuttoogle() {
  return {
    type: btn,
  };
}
function logintoogle() {
  return {
    type: btnin,
  };
}

function Loading() {
  return {
    type: loading,
  };
}

function Data() {
  return {
    type: data,
  };
}

function Error() {
  return {
    type: error,
  };
}

function loginData() {
  let url = "https://jsonplaceholder.typicode.com/posts";
  return async (dispatch) => {
    dispatch(Loading());
    try {
      const response = await fetch(url);
      const users = await response.json();
    } catch (error) {
      console.log(error);
    }
  };
}

export { loginData, logOuttoogle, logintoogle };
